import re
from typing import List

from core.gunnershell.bofs.base import Bof, register

from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

def _is_ip(s: str) -> bool:
    if not s: return False
    s = s.strip()
    if ':' in s or s.startswith('['): return True
    m = re.match(r'^\d{1,3}(\.\d{1,3}){3}$', s)
    if not m: return False
    parts = s.split('.')
    return all(0 <= int(p) <= 255 for p in parts)

@register("enumacls")
class EnumAclsBof(Bof):
    # drop in your own .o/.obj base64 the same way you do for other modules
    base64bof: str = ""

    @staticmethod
    def help_menu():
        print(brightgreen + """
enumacls — Outbound ACL Enumerator

Read-Only • Admin Utility • Authorized Environments Only

Usage
  bofexec enumacls -d <domain> [--dc HOST] [--ldaps] [--port N]
                   (--user <UPN|DN|sAM|SID> | --group <DN|sAM|SID> | --computer <DN|sAM|SID|hostname$> | --ou <DN>)
                   [--format csv|kv|table|json]

Flags
  -d, --domain <dns>    Domain DNS name (e.g., contoso.com). Used for baseDN derivation & parsing.
  --dc <hostname>       Domain Controller hostname/FQDN (no IPs); if omitted → DC locator.
  --ldaps               Use LDAPS (default port 636). Otherwise LDAP (389).
  --port <int>          Override port (0/omitted ⇒ default by scheme).

Selector (exactly one)
  --user <UPN|DN|sAM|SID>
  --group <DN|sAM|SID>
  --computer <DN|sAM|SID|hostname$>
  --ou <DN>             Special: enumerate OU delegations → trustees → outbound rights per trustee.

Output
  --format csv|kv|table|json  (default: kv)

Notes
  • Read-only: only LDAP reads and SD-Flags control to fetch DACLs.
  • Builds a membership graph (rank + via_path) via memberOf BFS.
  • Maps impactful rights: generic-all/write, write-dacl/owner, delete/delete-tree,
    create/delete child by class, extended:reset-password & replicate*, and attribute writes:
    SPN, RBCD, userAccountControl, member, etc.
  • Results include: subject, subject_sid (if available), target_dn, rank, via_path,
    right, right_kind, scope_hint, confidence, notes, timestamp.
""" + reset)
        return

    @staticmethod
    def args_inject(p):
        p.add_argument("-d", "--domain", required=True, help="DNS domain (e.g., contoso.com)")
        p.add_argument("--dc", default="", help="Domain Controller hostname/FQDN (not IP)")
        p.add_argument("--ldaps", action="store_true", default=False, help="Use LDAPS (default port 636)")
        p.add_argument("--port", type=int, default=0, help="LDAP/LDAPS port (0 => default by scheme)")

        sel = p.add_mutually_exclusive_group(required=True)
        sel.add_argument("--user", default="", help="UPN|DN|sAM|SID")
        sel.add_argument("--group", default="", help="DN|sAM|SID")
        sel.add_argument("--computer", default="", help="DN|sAM|SID|hostname$")
        sel.add_argument("--ou", default="", help="DN (OU only)")

        p.add_argument("--format", choices=["kv","csv","table","json"], default="kv", help="Output format")

    @staticmethod
    def build_remote_args(ns) -> List[str]:
        domain = getattr(ns, "domain", "") or ""
        dc     = getattr(ns, "dc", "") or ""
        if dc and _is_ip(dc):
            raise ValueError("--dc must be a hostname/FQDN (no IPs)")

        ldaps  = 1 if getattr(ns, "ldaps", False) else 0
        portIn = int(getattr(ns, "port", 0) or 0)
        port   = portIn if portIn > 0 else (636 if ldaps else 389)

        # selector
        selT = 0
        selV = ""
        if getattr(ns, "user", ""):
            selT, selV = 1, getattr(ns, "user")
        elif getattr(ns, "group", ""):
            selT, selV = 2, getattr(ns, "group")
        elif getattr(ns, "computer", ""):
            selT, selV = 3, getattr(ns, "computer")
        elif getattr(ns, "ou", ""):
            selT, selV = 4, getattr(ns, "ou")
        else:
            raise ValueError("exactly one of --user/--group/--computer/--ou is required")

        fmt_map = {"kv":0,"csv":1,"table":2,"json":3}
        fmtK = fmt_map.get(getattr(ns,"format","kv"), 0)

        args = [
            f"-Z:{domain}",
            f"-Z:{dc}",
            f"-i:{ldaps}",
            f"-i:{port}",
            f"-i:{selT}",
            f"-Z:{selV}",
            f"-i:{fmtK}",
        ]

        print(args)
        return args
